[[questions]]
id = "DC010"
question = "Vad innebär det att uppfylla WCAG 2.0 nivå AAA?"
answer = "Om däremot WCAG 2.0 nivå AAA (den högsta) ska gälla innebär det att det ska vara möjligt att få förkortningar förtydligade, att ord och begrepp som används på ovanliga sätt ska definieras, att det finns en metod eller funktion som anger hur ord ska uttalas om betydelsen av ordet i sitt sammanhang är tvetydigt samt att det ska finnas kompletterande eller alternativt innehåll för texter som kräver högre läsförmåga än högstadienivå."
difficulty = "Medium"
category = "Health"
