[[questions]]
id = "DC022"
question = "Hur har synen på konsumtion i förhållande till identitet förändrats över tid?"
answer = "Identiteten grundar sig i vad man producerade och tillförde samhället genom sitt yrke. När sedan dessa faktorer fick mindre vikt ökade konsumtionen som en viktigare arena att skapa sin identitet på. Eftersom identiteten är kopplad till konsumtionen är den därmed mer flexibel än tidigare."
