id = "DC023"
question = "Hur kan varumärkens betydelse ökas i framtiden?"
answer = "Vi menar dessutom att ytterligare en aspekt är att då tid uppfattas som en bristvara blir varumärket en katalysator i valsituationen. Vi kan därför mot stöd av våra intervjuer och litteraturstudier vara benägna att stödja Kotlers och Pfoertsch uttalande om ”att i framtiden kommer varumärken förmodligen vara den enda riktigt hållbara konkurrensfördelen hos företag”."
