id = "DC051"
question = "Vilken typ av e-handelsmodell beskriver företag som säljer till privatpersoner?"
answer = "Till att börja med så beskriver vi business-to-consumer (B2C) som är en e-handelsmodell där företag eller organisationer säljer produkter eller tjänster till privatpersoner och denna typ av handel kallas också för e-tailing (online retailing)(Turban et al., 2004)."
