[[questions]]
id = "DC055"
question = "Vad krävs för att e-handeln ska vara attraktivt?"
answer = "Enligt Post & telestyrelsen (2001) så måste man som kund ha tillgång till en hög överföringskapacitet där nedladdningarna går fort för att det ska vara attraktivt att handla via Internet, detta gäller främst vid användandet av sidor som kräver större informationsinhämtningar som till exempel sidor med mycket bilder."
