[[questions]]
id = "DC074"
question = "Hur beskattas kryptomining i Sverige?"
answer = "Därför kan mining, enligt Skatteverket, inte beskattas i inkomstslaget kapital, jfr 41 kap. 1-2 §§ IL. Följaktligen beskattas sådana verksamheter främst som hobby i inkomstslaget tjänst, se 10 kap. 1 § 2 st IL. Under förutsättning att den bedrivs yrkesmässigt och med vinstsyfte ska dock beskattning ske som näringsverksamhet enligt 13 kap."
difficulty = "Hard"
category = "Economy"
