id = "DC075"
question = "Vad är skillnaden mellan redovisningen i näringsverksamhet och tjänst?"
answer = "I näringsverksamhet ska den ske på bokföringsmässiga grunder enligt 14 kap. 2 § IL, medan i tjänst sker redovisningen i enlighet med kontantprincipen i 10 kap. 8 och 13 §§ IL."
