question = "Vad är legalitetsprincipen inom skatterätten?"
answer = "Legalitetsprincipen inom skatterätten har ingen klar definition, men anses inom doktrinen vara uttryckt i 1 kap. 1 § 3 st. regeringsformen, RF. Bestämmelsen anger att den offentliga makten ska utövas under lagarna."
