[[questions]]
id = "DC088"
question = "Kan underlagen från krypto handelsplatser anvädas som grund för beskattning?"
answer = "Underlagen är dock inte särskilt anpassade i förhållande till genomsnittsmetoden och den beräkning av ett genomsnittligt omkostnadsbelopp som måste ske efter varje transaktion för att uppnå en korrekt kapitalvinstbeskattning. De kan således inte läggas till grund för beskattning utan ett omräkningsförfarande."
