id = "DC092"
question = "När anser Skatteverket att granskningsförfarandet ska vara genomfört?"
answer = "Såsom texten i avsnitt III. B i bilaga VI till DAC och motsvarande skrivning i CARF har utformats anser Skatteverket att en rimlig tolkning är att granskningsförfarandet avseende personer med bestämmande inflytande ska vara genomfört i sin helhet innan någon rapporteringspliktig transaktion utförs av den rapporteringsskyldiga leverantören."
