question = "Hur defineras försäkring i internationell litteratur?"
answer = "”Försäkring är ett redskap för att reducera risk genom att förena ett tillräckligt antal riskenheter för att göra deras individuella skador kollektivt förutsägbara och därefter fördela de förutsägbara skadorna proportionellt på alla riskenheterna”."
