id = "DC106"
question = "Vad är försäkringsmatematik?"
answer = "Försäkringsmatematik brukar vanligen beskrivas som läran om tillämpning av matematiska och statistiska metoder inom försäkring,18 dvs. den del av försäkringstekniken som främst syftar till att matematiskt beräkna risken för att ett försäkringsfall inträffar, göra premieberäkningar, beräkna storleken på reservsättningar och framställa underlag för utformning av återförsäkring."
difficulty = "Medium"
category = "Economy"
