[[questions]]
id = "DC113"
question = "Kan enskilda företag påverka marknadens utveckling?"
answer = "Dessutom formas marknaden beroende på hur enskilda företag agerar i förhållande till varandra eftersom fokus inte längre endast ligger på det enskilda tillfället när säljare och köpare möts. De enskilda företagen kan därmed påverka hur marknaden kommer utvecklas."
difficulty = "Easy"
category = "Economy"
